      useEffect(()=>{
        axios.get('https://jsonplaceholder.typicode.com/posts/1/comments')
        .then((val)=>{
            console.log('VAl==>>>',val)
            setData(val.data)
        })
        .catch(err=> console.log('error0',err))
      },[])

    return(

       <div>

       </div>

    )
}

export default Practice;
